import React from 'react';
import Products from './components/Products';
import Carts from './components/Carts';
import Message from './components/Message';

function App() {
    return (
        <main id="mainContainer">
            <div className="container">
                <Products></Products>
                <Message></Message>
                <Carts></Carts>
            </div>
        </main>
    );
}

export default App;
